import React from "react";
import PublicUp from "./PublicUp";
import './Home.css';
import './Memo.css'

export default function Home() {
  return (
    <React.Fragment>
      <header className="header"></header>
      <div className="MainBanner"></div>
      <main className="Main">
        <div className="LeftBar"></div>
        <div className="Content">
          <div className="WhatsYourImage"/>
          <img className="Description1" src="./img/Descr1.png" alt="Description1" />
          <img className="Description2" src="./img/Descr2.png" alt="Description2" />
        </div>
        <div className="RightBar"></div>
      </main>
      {/* <div className="MainBanner" />
      <div className="home2" />
      <div className="home3" />
      <div className="home4">
        <button className="btndesign" onClick={() => { window.location.href = "/login" }}>로그인</button>
      </div> */}
    </React.Fragment>
  );
}
